import React, { Component } from "react";
import Footer from "./components/Footer";
import Header from "./components/Header";
import ProductItem from "./components/products/ProductItem";
import "./App.css";
export default class App extends Component {
  constructor(props) {
    super(props);
    this.state = { products: "" };
  }
  componentDidMount() {
    this.setState({
      products: [
        {
          productId: 0,
          productName: "Mocca Frappucino",
          unitPrice: 120,
          productImg: "/img/starbucksLogo.png",
        },
        {
          productId: 0,
          productName: "Mocca Frappucino",
          unitPrice: 120,
          productImg: "/img/starbucksLogo.png",
        },
        {
          productId: 0,
          productName: "Mocca Frappucino",
          unitPrice: 120,
          productImg: "/img/starbucksLogo.png",
        },
        {
          productId: 0,
          productName: "Mocca Frappucino",
          unitPrice: 120,
          productImg: "/img/starbucksLogo.png",
        },
      ],
    });
  }
  render() {
    return (
      <div className="container">
        <Header />
        <ProductItem productName="Mac book Pro 13" unitPrice="15,000" />
        <ProductItem productName="Mac book Pro 16" unitPrice="35,000" />
        <ProductItem productName="iMac Pro" unitPrice="55,000" />
        <Footer companyName="One Geo Survey" copyRight="bump@ogs" />
      </div>
    );
  }
}
